INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (2812, 'Anyway, your Grandpa hit him with the car and brought him into the house. He seemed so helpless, like a little lost puppy, and my heart just went out to him.', 'Quo Lux', 'Clark Oberbrunner Sr.');
