INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (3890, 'He''s an idiot. Comes from upbringing. His parents are probably idiots, too. Lorraine, you ever have a kid who acts that way, I''ll disown you.', 'Bytecard', 'Tina Koepp');
