INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7339, 'Hey, come on. I had to change. Do you think I''m going back in that-that zoot suit? The old man really came through. It worked!', 'Wrapsafe', 'Brendon Cartwright Jr.');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7340, 'Well, I figured, what the hell?', 'Sub-Ex', 'Percy McLaughlin');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7341, 'And one for you, McFly; I believe that makes four in a row. Now let me give you a nickel''s worth of free advice, young man. This so-called Dr. Brown is dangerous. He''s a real nutcase. You hang around with him, you''re gonna end up in big trouble.', 'Namfix', 'Miss Darell Funk');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7342, 'Last night, Darth Vader came down from Planet Vulcan and told me that if I didn''t take Lorraine out, that he''d melt my brain.', 'Toughjoyfax', 'Kareem Purdy');
