INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7344, 'No wonder your president has to be an actor. He''s gotta look good on television.', 'It', 'Dr. Albert Daugherty');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7345, 'Since you''re new here, I-I''m gonna cut you a break, today. So, why don''t you make like a tree and get outta here?', 'Duobam', 'Quintin Emmerich');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7346, 'Marty, don''t be such a square. Everybody who''s anybody drinks.', 'Trippledex', 'Antonia Marks');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7347, 'Anyway, your Grandpa hit him with the car and brought him into the house. He seemed so helpless, like a little lost puppy, and my heart just went out to him.', 'Konklux', 'Sammie Wilderman');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7348, 'Stella! Another one of these damn kids jumped in front of my car! Come on out here! Help me take him in the house!', 'It', 'Tory Reynolds');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7349, 'If you put your mind to it, you can accomplish anything.', 'Sub-Ex', 'Sebastian Russel PhD');
