INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7352, 'Next saturday night we''re sending you back to the future!', 'Toughjoyfax', 'Ruthie Rau');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7353, 'Okay, thank you. That''s enough. Hold it now. Hold it. Hold it, fellas. I''m afraid you''re just too darn loud. Next, please. Bring in the next group, please.', 'Andalax', 'Mrs. Cheryle Schuster');
