INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7358, 'I can''t believe you''d loan me your car without telling me it had a blind spot. I could''ve been killed!', 'Tin', 'Freddie McLaughlin');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7359, 'There''s that word again. ''Heavy.'' Why are things so heavy in the future? Is there a problem with the Earth''s gravitational pull?', 'Temp', 'Wilson Emmerich');
