INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7377, 'What about all that talk about screwing up future events? The space-time continuum?', 'Regrant', 'Colby Ebert');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7378, 'No! Marty! We''ve already agreed that having information about the future can be extremely dangerous. Even if your intentions are good, it can backfire drastically!', 'Overhold', 'Franklin Weber');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7379, 'The appropriate question is, ''when the hell are they?'' You see, Einstein has just become the world''s first time traveler! I sent him into the future. One minute into the future to be exact. And at precisely 1:21 a.m. and zero seconds, we shall catch up with him and the time machine.', 'Wrapsafe', 'Leeanne Wiza');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7380, 'It''s gonna be really hard waiting 30 years before I can talk to you about everything that''s happened in the past few days. I''m really gonna miss you, Marty.', 'Subin', 'Aron Schumm III');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7381, 'Calvin? Wh... Why do you keep calling me Calvin?', 'Voyatouch', 'Jarrett Keeling MD');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7382, 'He''s an idiot. Comes from upbringing. His parents are probably idiots, too. Lorraine, you ever have a kid who acts that way, I''ll disown you.', 'Zathin', 'George Dibbert');
