INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7391, 'I noticed your band is on the roster for the dance auditions after school today. Why even bother, McFly? You don''t have a chance. You''re too much like your old man. No McFly ever amounted to anything in the history of Hill Valley!', 'Lotstring', 'Mr. Horace Bosco');
