INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (7399, 'Look, I''m just not ready to ask Lorraine out to the dance, and not you, or anybody else on this planet is gonna make me change my mind.', 'Hatity', 'Efrain Barton');
