INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8435, 'We''re the, uh... We''re the Pinheads.', 'Redhold', 'Aura Pfeffer');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8436, 'Hey, come on. I had to change. Do you think I''m going back in that-that zoot suit? The old man really came through. It worked!', 'Holdlamis', 'Jerri Herman');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8437, 'Okay. Time circuit''s on. Flux capacitor, fluxing. Engine running. All right.', 'Biodex', 'Eileen Kuphal');
