INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8440, 'I noticed your band is on the roster for the dance auditions after school today. Why even bother, McFly? You don''t have a chance. You''re too much like your old man. No McFly ever amounted to anything in the history of Hill Valley!', 'It', 'Herbert Kulas');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8441, 'Since when can weathermen predict the weather, let alone the future?', 'Bitchip', 'Garret Ullrich');
