INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8446, 'All right. This is an oldie, but, uh... well, it''s an oldie where I come from.', 'Duobam', 'Dr. Inocencia Cummerata');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8447, 'I''ve had enough practical jokes for one evening. Good night, future boy!', 'Quo Lux', 'Brooks Borer');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8448, 'Biff. What a character. Always trying to get away with something. I''ve had to stay on top of Biff ever since high school. Although, if it wasn''t for him...', 'It', 'Dr. Antony Hirthe');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8449, 'Wait a minute. Wait a minute, Doc. Ah... Are you telling me that you built a time machine... out of a DeLorean?', 'Mat Lam Tam', 'Earleen Bayer');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8450, 'It''s already mutated into human form! Shoot it!', 'Regrant', 'Penny Halvorson');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8451, 'Now, Biff, I want to make sure that we get two coats of wax this time, not just one.', 'Overhold', 'Julee Botsford DVM');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8452, 'The appropriate question is, ''when the hell are they?'' You see, Einstein has just become the world''s first time traveler! I sent him into the future. One minute into the future to be exact. And at precisely 1:21 a.m. and zero seconds, we shall catch up with him and the time machine.', 'Otcom', 'Dr. Cathleen Boyle');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8453, 'Oh, honey, he''s teasing you. Nobody has two television sets.', 'Lotlux', 'Eldridge Robel Jr.');
