INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8463, 'No! Marty! We''ve already agreed that having information about the future can be extremely dangerous. Even if your intentions are good, it can backfire drastically!', 'Quo Lux', 'Agustin Goldner');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8464, 'Now, remember. According to my theory, you interfered with your parents'' first meeting. If they don''t meet, they won''t fall in love, they won''t get married and they won''t have kids. That''s why your older brother''s disappearing from that photograph. Your sister will follow, and unless you repair the damage, you''ll be next.', 'Temp', 'Tisa Pollich');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8465, 'And one for you, McFly; I believe that makes four in a row. Now let me give you a nickel''s worth of free advice, young man. This so-called Dr. Brown is dangerous. He''s a real nutcase. You hang around with him, you''re gonna end up in big trouble.', 'Stim', 'Ozell Fisher');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8466, 'I g-guess you guys aren''t ready for that yet. But your kids are gonna love it.', 'Alpha', 'Michiko Renner');
