INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (8469, 'Stand tall, boy. Have some respect for yourself. Don''t you know, if you let people walk over you now, they''ll be walking over you for the rest of your life. Look at me. You think I''m gonna spend the rest of my life in this slop house?', 'Lotstring', 'Jennifer Ratke');
