INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (9166, 'No, get out of town. My mom thinks I''m going camping with the guys. Look, Jennifer, my mother would freak out if she knew I was going out with you, and I''d get the standard lecture about how she never did that kind of stuff when she was a kid. I mean, look, I think the woman was born a nun.', 'Zaam-Dox', 'Alec Mosciski');
