INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (10502, 'Now, remember. According to my theory, you interfered with your parents'' first meeting. If they don''t meet, they won''t fall in love, they won''t get married and they won''t have kids. That''s why your older brother''s disappearing from that photograph. Your sister will follow, and unless you repair the damage, you''ll be next.', 'Flowdesk', 'Silas Flatley');
