INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11337, 'Hey, McFly! I thought I told you never to come in here.', 'Y-find', 'Demetria Abernathy');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11338, 'Calvin? Wh... Why do you keep calling me Calvin?', 'Veribet', 'Foster Jacobi');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11339, 'Hey, Dad! George! Hey, you on the bike!', 'Toughjoyfax', 'Otha Schmidt DDS');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11340, 'What happens to us in the future? Do we become assholes or something?', 'Stringtough', 'Walter Balistreri');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11341, 'Don''t worry. As long as you hit that wire with the connecting hook at precisely 88 miles per hour, the instant the lightning strikes the tower... everything will be fine.', 'Span', 'Hollis Turcotte');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11342, 'Weight has nothing to do with it.', 'Vagram', 'Dr. Hai Glover');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11343, 'Great Scott!', 'Hatity', 'Kraig Baumbach');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11344, 'Course! From a group of Lybian Nationalists They wanted me to build them a bomb, so I took their plutonium and in turn I gave them a shiny bomb caseing full of used pinball machine parts!', 'Asoka', 'Ms. Elisabeth Gusikowski');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11345, 'You know, Marty, you look so familiar to me. Do I know your mother?', 'Toughjoyfax', 'Hope Yundt');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11346, 'Look, Marvin, you gotta play. See, that''s where they kiss for the first time on the dance floor. And if there''s no music, they can''t dance. If they can''t dance, they can''t kiss. If they can''t kiss they can''t fall in love, and I''m history.', 'Tin', 'Wallace Considine');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11347, 'Crazy drunk driver.', 'Temp', 'Dr. Rigoberto Beer');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11348, 'He laid out Biff in one punch. I didn''t know he had it in him. He''s never stood up to Biff in his life!', 'Subin', 'Kenton Nitzsche');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11349, 'You''re late! Do you have no concept of time?', 'Flowdesk', 'Gillian Cartwright');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11350, 'Hey, hey, listen, guys... Look, I don''t wanna mess with no reefer addicts, okay?', 'Veribet', 'Mana Goodwin');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11351, 'He''s an absolute dream!', 'Pannier', 'Lucrecia Wilderman');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11352, 'Whoa. Wait a minute, Doc. Are you trying to tell me that my mother has got the hots for me?', 'Ventosanzap', 'Nickolas Lemke');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11353, 'You really think I ought to swear?', 'Pannier', 'Mercy Abbott');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11354, 'Roads? Where we''re going, we don''t need roads.', 'Cardguard', 'Janine Pacocha');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11355, 'No wonder your president has to be an actor. He''s gotta look good on television.', 'Toughjoyfax', 'Collene Donnelly MD');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11356, 'I noticed your band is on the roster for the dance auditions after school today. Why even bother, McFly? You don''t have a chance. You''re too much like your old man. No McFly ever amounted to anything in the history of Hill Valley!', 'Regrant', 'Roy Schaefer I');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11357, 'Oh, that''s Joey. He cries when we take him out so we just leave him in there.', 'Alpha', 'Dr. Edmond Kirlin');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11358, 'Crazy drunk driver.', 'Treeflex', 'Tiana Bernhard');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11359, 'We''re the, uh... We''re the Pinheads.', 'Holdlamis', 'Albertina Gleichner');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11360, 'Marty, don''t be such a square. Everybody who''s anybody drinks.', 'Home Ing', 'Todd Franecki MD');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11361, 'Now, remember. According to my theory, you interfered with your parents'' first meeting. If they don''t meet, they won''t fall in love, they won''t get married and they won''t have kids. That''s why your older brother''s disappearing from that photograph. Your sister will follow, and unless you repair the damage, you''ll be next.', 'Trippledex', 'Clement Gislason');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11362, 'Since when can weathermen predict the weather, let alone the future?', 'Lotstring', 'Mrs. Rusty Nienow');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11363, 'He''s an absolute dream!', 'Ventosanzap', 'Miss Salena Gaylord');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11364, 'Okay. Time circuit''s on. Flux capacitor, fluxing. Engine running. All right.', 'Bytecard', 'Gertrude Legros');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11365, 'Okay. Time circuit''s on. Flux capacitor, fluxing. Engine running. All right.', 'Tin', 'Drucilla Stiedemann');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11366, 'Weight has nothing to do with it.', 'Konklux', 'Keira Schulist');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11367, 'Who the hell is John F. Kennedy?', 'Cardify', 'Kennith Koch');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11368, 'I''m gonna get that son of a bitch.', 'Duobam', 'Stacey D''Amore');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11369, 'What if I send in the tape and they don''t like it? I mean, what if they say I''m no good? What if they say ''Get outta here, kid. You got no future''? I mean, I just don''t think I can take that kind of rejection. Jesus, I''m starting to sound like my old man!', 'Duobam', 'Arcelia Beier');
INSERT INTO public.all_objects (rownum, object_name, object_type, owner) VALUES (11370, 'Okay, thank you. That''s enough. Hold it now. Hold it. Hold it, fellas. I''m afraid you''re just too darn loud. Next, please. Bring in the next group, please.', 'Quo Lux', 'Dr. Emeline Heaney');
